  false,\n\t\"url\": null,\n\t\"notes\": \"The FHA Office of Housing is conducting
  a series of mortgage loan sales under the Single Family Loan Sale (SFLS) Initiative.
  The current sales structure consists of whole loan, competitive auctions, offering
  for purchase defaulted single family mortgages provided by FHA-approved loan servicers.
  The loans sold contain specified representations and warranties and may be sold
  with post-sale restrictions and/or reporting requirements. Currently, the FHA is
  selling loans in large national pools, as well as loan pools in designated geographical
  areas that are aimed at a neighborhood stabilization outcome (u201cNSO poolsu201d).\",\n\t\"license_title\":
